// to get the data instead of putting it in index.html bc React doesn't allow that

import React, { useEffect, useState } from 'react';

const DataFetcher = () => {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetch('http://localhost:3001/data')
      .then((response) => {
        if (!response.ok) {
          throw new Error(`HTTP error! status: ${response.status}`);
        }
        return response.json();
      })
      .then((data) => {
        setData(data);
      })
      .catch((error) => console.error('Error fetching data:', error));
  }, []);

  return (
    <div>
      <h1>Data from MongoDB</h1>
      <div id="data-container">
        {data.map((item, index) => (
          <div key={index}>
            <h2>Bill Details</h2>
            <p>Bill Number: {item.bill?.billNumber || 'N/A'}</p>
            <p>Action Description: {item.bill?.actionDesc || 'N/A'}</p>
            <p>Introduced Date: {item.bill?.introducedDate || 'N/A'}</p>
            <p>
              Keywords: {item.keywordsMatched?.map((keyword, keywordIndex) => (
                <span key={keywordIndex}>{keyword} </span>
              )) || 'No keywords available'}
            </p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default DataFetcher;
